import React from "react";

function Home() {
  return (
    <div>
      <h2>Welcome to the Real Estate Dashboard</h2>
      <p>Explore real estate listings and contact us for more information.</p>
      <p>
        {" "}
        This real estate dashboard shows you property values of places in South
        Bend. Use the links below to see the properties{" "}
      </p>
      <p>
        {" "}
        You can use the Contact link to place a bid for a specific property and
        enter our details so that we can reach you
      </p>
    </div>
  );
}

export default Home;
